import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function ProjectManager({ user, onJoin }) {
  const [projectName, setProjectName] = useState('');
  const [projectDesc, setProjectDesc] = useState('');
  const [projectId, setProjectId] = useState('');
  const [joinProjectId, setJoinProjectId] = useState('');
  const navigate = useNavigate();

  const handleCreateProject = () => {
    if (projectName && projectDesc && projectId) {
      alert(`Project "${projectName}" created with ID: ${projectId}`);
    } else {
      alert('Please fill all fields to create a project');
    }
  };

  const handleJoinProject = () => {
    if (joinProjectId) {
      onJoin(joinProjectId);
      navigate('/projectDashboard');
    } else {
      alert('Enter a project ID to join');
    }
  };

  return (
    <div className="card">
      <h2>Welcome, {user}!</h2>

      <h3>Create New Project</h3>
      <input
        type="text"
        placeholder="Project Name"
        value={projectName}
        onChange={(e) => setProjectName(e.target.value)}
      />
      <input
        type="text"
        placeholder="Project Description"
        value={projectDesc}
        onChange={(e) => setProjectDesc(e.target.value)}
      />
      <input
        type="text"
        placeholder="Project ID"
        value={projectId}
        onChange={(e) => setProjectId(e.target.value)}
      />
      <button className="create-button" onClick={handleCreateProject}>Create Project</button>

      <hr style={{ width: '100%' }} />

      <h3>Use Existing Project</h3>
      <input
        type="text"
        placeholder="Project ID"
        value={joinProjectId}
        onChange={(e) => setJoinProjectId(e.target.value)}
      />
      <button className="view-button" onClick={handleJoinProject}>Access Project</button>
    </div>
  );
}

export default ProjectManager;
